export const init = (db:any) => {
   has_location_tables(db,(err,hasTables) => {
     if(!hasTables){
       create_location_tables(db,(err, isSuccess) => {
          if(isSuccess){
            add_locations_data(db);
          }
       });
     } else {
        //TODO
     }
   })
}

export const search_city = (db:any,text: string, limit: number, cb: (error: any, rs:any) => void) => {

   db.transaction((tx) => {
      tx.executeSql("SELECT rowid as id, * FROM Cities WHERE Name LIKE ? LIMIT ?",['%' + text + '%',limit],
     (tx,rs) => {
          
          cb(null,rs);
      },
     (tx,e) => {
          cb(e,null);
      });
    });

}

export const get_results_array = (rows:any,maxResulst: number = 10) => {
  const limit = rows.length < maxResulst ? rows.length : maxResulst;
  const results = [];
  for(let i = 0; i < limit; i++){
    results.push(rows.item(i));
  }
  return results;
}

export const search_zipcodes = (db:any,text: string, limit: number,cb: (error: any, rs:any) => void) => {

   db.transaction((tx) => {
      tx.executeSql("SELECT rowid as id, * FROM Zipcodes WHERE Zipcode LIKE ? LIMIT ?",['%' + text + '%',limit],
     (tx,rs) => {
          cb(null,rs)
      },
     (tx,e) => {
          cb(e,null)
      });
    });

}




